import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';

class Aggregate extends Component {
    render() {
        return (
            <div>
                <h2>Number Text</h2>
            </div>
        );
    }
}

class App extends Component {
  render() {
    return (
        <body background="http://static.tumblr.com/jw8fmba/RqUluoxaa/309560.jpeg">
            <div className="App">
                <h1>Title</h1>
                <Aggregate/>
            </div>
        </body>
    );
  }
}
export default App;
